       */}

      <Menu />
        <Routes>
          <Route exact path="/" Component={About} />
          <Route exact path="/contact" Component={Contact} />
          <Route path="/contact/name" Component={Name} />
          <Route Component={Error} />
        </Routes>
      
    </>
  );
};

export default App;
